import React from 'react'

export default function ErrorCheck({msg,err,}) {
    if(!err.response)
    return msg
    if(!err.response.data)
    return msg
    if(!err.response.data.error)
    return msg
    if(!err.response.data.error.message)
    return msg
    return err.response.data.error.message;
}
